import React from "react";
import Details from "./Details";
import { Link } from "react-router-dom";

const Contacts = ({ cinemaWorld }) => {
  return (
    <div>
      <center>
        <h1 style={{ fontSize: 45, color: "grey" }}>CinemaWorld Movies</h1>
      </center>
      {cinemaWorld.map((movie) => (
        <div class="card">
          <div class="card-body">
            <img src={movie.Poster}></img>
            <h5 class="card-title">{movie.Title}</h5>
            <Link class="card-subtitle mb-2 text-muted" to={"./details"}>
              {movie.Title}
            </Link>
            <tr>
              <td>
                <Link to={"/details"}>
                  <Details id={movie.ID} />
                  Movie Details
                </Link>
              </td>
            </tr>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Contacts;
